import React from 'react';
//Styles imports
import {Navbar, Nav, NavItem} from 'react-bootstrap'
import {NavLink} from 'react-router-dom'

const NaviBar = ({}) => (
  <Navbar inverse>
    <Navbar.Header>
      <Navbar.Brand>
        <img src="http://www.stickpng.com/assets/images/580b57fcd9996e24bc43c513.png" alt="img"/>
      </Navbar.Brand>
    </Navbar.Header>
    <Nav>
      <NavItem>Accueil</NavItem>
    </Nav>
  </Navbar>

);

export default NaviBar;
